import React from 'react'

import pageLinks from './data'

function App() {
  return (
    <div>
      {pageLinks.map((link) => {
        return (
          <li key={link.id}>
            <a href={link.href}>
              {link.text}

            </a>
          </li>
        )
      })}
    </div>
  )
}

export default App
